export default function Recipt({data}) {
  return (
      <div>
       {data.map(val => (
                <div key={val.id} className="card-container">
                    <h1>{val.name}</h1>
                    <p>{val.email}</p>
                    <div> {val.addrss}</div>
                </div>
       ))}
      </div>
  )
}
